import {useEffect, useState} from "react";
import axios from "axios";

export default function ProductList(props) {
    const [products, setProducts] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:8080/api/products')
            .then(response => {
                setProducts(response.data);
            })
            .catch(error => {
                console.log(error);
            });
    }, []);

    return (
        <>
            <div className="container">
                <section className="section-newsfeed">
                    <div className="content">
                        {products.map((product, index) => (
                            <div className="list-item eatery-item-landing" key={index}>
                                <div className="img-lazy figure square">
                                    <div className="    img" style={{backgroundImage: `url(${product.image})`}}></div>
                                </div>
                                <div className="content">
                                    <div className="name mb-5">
                                        {product.name}
                                    </div>
                                    <div className="name mb-5">
                                        {product.address}
                                    </div>
                                    <div className="promotion">
                                        <i className="fa-solid fa-tag"></i>
                                        <span>{product.promotion}</span>
                                    </div>
                                </div>
                            </div>
                        ))}
                    </div>
                </section>
            </div>
        </>
    );
}
